// Default imports
import React from 'react';
import './App.css';

// Custom imports
import Home from "./components/home";
import 'materialize-css/dist/css/materialize.css';
import {BrowserRouter, Route} from "react-router-dom";

function App() {
    return (
        // HTML here
        <BrowserRouter>
            <div className="App">
                <Route path='/' component={Home}/>
                <Route path='/about' compo />
            </div>
        </BrowserRouter>
    );
}

// Default export
export default App;
